import css from 'styled-jsx/css';

export default css`.news-card-wrap {
  width: 1197px;
  height: 323px;
  background: #ffffff;
  box-shadow: 0px 12px 23px 4px rgba(216, 223, 229, 0.65);
  box-sizing: border-box;
  padding: 41px 35px;
}
.news-card-wrap .pic-wrap {
  width: 400px;
  height: 241px;
  overflow: hidden;
  border: 1px solid #eee;
  float: left;
}
.news-card-wrap .pic-wrap img {
  width: 100%;
  height: 100%;
}
.news-card-wrap .content {
  padding-left: 80px;
  border: 1px solid;
  overflow: hidden;
}
`
